&lt;p&gt;In the question a statement is given, followed by two arguments, I and II. You have to consider the statement to be true even if it seems to be at variance from commonly known facts. You have to decide which of the given arguments, if any, is a strong argument.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statement:&lt;/strong&gt; Should the sale of alcohol near highways be banned?&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Argument I:&lt;/strong&gt; No, people should have the freedom to decide as it is their fundamental right.&lt;/p&gt;
&lt;strong&gt;Argument II:&lt;/strong&gt; Yes, 90% of road accidents involve drivers who are under influence of alcohol.

