&lt;p&gt;निम्न प्रश्न में एक कथन और उसके बाद दो तर्क I और II दिए गये हैं। आपको दिए गये कथन को सत्य मानना है, भले ही वे ज्ञात तथ्यों से अलग प्रतीत होते हों। आपको तय करना है कि, निम्नलिखित तर्कों में से कौनसे तर्क प्रबल&amp;nbsp;हैं।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन:&lt;/strong&gt; क्या राजमार्ग के निकट शराब का विक्रय बंद होना चाहिए?&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;तर्क&lt;/strong&gt;&lt;strong&gt; I: &lt;/strong&gt;नहीं, व्यक्तियों को इसकी आज़ादी होनी चाहिए क्योंकि यह उनका मौलिक अधिकार है।&lt;/p&gt;
&lt;strong&gt;तर्क&lt;/strong&gt;&lt;strong&gt; II:&lt;/strong&gt;&amp;nbsp;हाँ, सड़क दुर्घटना में 90% चालक वे होते हैं जो शराब के प्रभाव में होते हैं।

